<script>
import router from '../router/index'
import { clearAuthToken } from '../services/auth'

export default {

    props: {
        
        name: {
            type: String,
            required: true,
        },

        cpf: {
            type: String,
            required: true,
        },

        init: {
            type: String,
            required: true,
        },
        
        expire: {
            type: String,
            required: true,
        },

        public_hash: {
            type: String,
            required: true,
        },

        private_hash:{
            type: String,
            required: true,
        },
    },
    
    data(){
        return{

            secret_id: false,

            form: {
                name: '',
                cpf: '',
                init: '',
                end: '',
                public: '',
                private: '',
            },

            name_value: this.name,
            cpf_value: this.cpf,
            init_value: this.init,
            expire_value: this.expire,
            public_value: this.public_hash,
            private_value: this.private_hash
        }

    },

    methods: {

        backToHomepage(){ 
            router.push({ name: 'index' }) 
        },

        changeValues(name, cpf, init, end, pub, priv){

            document.getElementById('name_value').textContent = name
            document.getElementById('cpf_value').textContent = cpf
            document.getElementById('init_value').textContent = init
            document.getElementById('expire_value').textContent = end
            document.getElementById('public_hash_value').textContent = pub
            document.getElementById('private_hash_value').textContent = priv

            this.secret_id = true
        },

        openNewWindow(){
            const svg = document.querySelector('svg');
            const as_text = new XMLSerializer().serializeToString(svg);
            const blob = new Blob([as_text], { type: "image/svg+xml" });
            const url = URL.createObjectURL(blob);
            const win = open(url);
            win.onload = () => URL.revokeObjectURL(url);
            win.print()
        },

        backConditional(){
            if(!this.name_value){
                this.backToHomepage()
            }
        },

    },

    created() {
        clearAuthToken()
    },

    mounted(){

        this.changeValues(this.name_value, this.cpf_value, this.init_value, this.expire_value, this.public_value, this.private_value)

        this.backConditional()
    },
}
</script>

